 *
 * @param {any} data - The data to be pruned.
 * @returns {any} - The pruned data.
 */
function pruneArrays(data) {
  if (Array.isArray(data)) {
    // If it's an array, keep only the first item (if any)
    if (data.length > 0) {
      return [pruneArrays(data[0])];
    } else {
      return [];
    }
  } else if (data !== null && typeof data === 'object') {
    // If it's an object, recursively prune its properties
    const prunedObject = {};
    for (const key in data) {
      if (data.hasOwnProperty(key)) {
        prunedObject[key] = pruneArrays(data[key]);
      }
    }
    return prunedObject;
  } else {
    // If it's a primitive value, return it as is
    return data;
  }
}

