// Define the function to get the team timesheet status with project data
function getTeamTimeSheetStatus(team, time_entries, projects, timeRangeName) {
  // Get the start and end dates based on the time range name
  const { startDate, endDate } = getStartAndEndDates(timeRangeName);

  // Convert startDate and endDate to ISO strings for comparison
  const startISO = startDate.toISOString();
  const endISO = endDate.toISOString();

  // Create a map of team members by identity_id
  const teamMembersMap = {};
  team.forEach(member => {
    teamMembersMap[member.identity_id] = {
      name: `${member.first_name} ${member.last_name}`,
      identity_id: member.identity_id,
      projects: {}
    };
  });

  // Create a map of projects by project_id
  const projectMap = {};
  projects.forEach(projectItem => {
    const project = projectItem;
    if (project && project.client_id && project.active) {
      // console.log("project", project)
      projectMap[project.id] = {
        data: project,
        memberIds: project.group.members.map(member => member.identity_id)
      };
    }
  });

  // Assign projects to team members based on membership
  Object.values(projectMap).forEach(projectInfo => {
    const projectId = projectInfo.data.id;
    projectInfo.memberIds.forEach(identity_id => {
      if (teamMembersMap[identity_id]) {
        // Initialize the project in the team member's projects if not already
        if (!teamMembersMap[identity_id].projects[projectId]) {
          teamMembersMap[identity_id].projects[projectId] = {
            project: projectInfo.data,
            entries: [],
            entries_meta: {
              total_hours_logged: 0,
              total_entries: 0,
              "hours logged possible": 0
            }
          };
        }
      }
    });
  });

  // Filter time entries within the time range
  const timeEntriesInRange = time_entries.filter(entry => {
    const startedAt = entry.started_at;
    return startedAt >= startISO && startedAt <= endISO;
  });

  // Process time entries and assign them to team members and projects
  timeEntriesInRange.forEach(entry => {
    const identity_id = entry.identity_id;
    const project_id = entry.project_id;

    if (teamMembersMap[identity_id]) {
      let memberProjects = teamMembersMap[identity_id].projects;

      // If project_id is valid and exists in projectMap
      if (project_id && projectMap[project_id]) {
        // Initialize the project in the member's projects if not already
        if (!memberProjects[project_id]) {
          memberProjects[project_id] = {
            project: projectMap[project_id].data,
            entries: [],
            entries_meta: {
              total_hours_logged: 0,
              total_entries: 0,
              "hours logged possible": 0
            }
          };
        }

        // Add the entry to the project's entries
        memberProjects[project_id].entries.push(entry);

        // Update entries_meta
        memberProjects[project_id].entries_meta.total_hours_logged += entry.duration / 3600; // Convert seconds to hours
        memberProjects[project_id].entries_meta.total_entries += 1;
      } else {
        // Handle entries without a valid project_id
        const unknownProjectId = 'Unknown';
        if (!memberProjects[unknownProjectId]) {
          memberProjects[unknownProjectId] = {
            project: { id: unknownProjectId, title: 'Unknown Project' },
            entries: [],
            entries_meta: {
              total_hours_logged: 0,
              total_entries: 0,
              "hours logged possible": 0
            }
          };
        }
        memberProjects[unknownProjectId].entries.push(entry);
        memberProjects[unknownProjectId].entries_meta.total_hours_logged += entry.duration / 3600; // Convert seconds to hours
        memberProjects[unknownProjectId].entries_meta.total_entries += 1;
      }
    }
  });

  // For team metadata, calculate total_hours_logged and total_hours_possible
  const totalHoursLogged = timeEntriesInRange.reduce((sum, entry) => sum + entry.duration, 0) / 3600; // Convert seconds to hours

  // Calculate total hours possible
  const workingHoursPerDay = 8;
  const workingDays = getWorkingDaysBetweenDates(startDate, endDate);
  const totalHoursPossible = workingHoursPerDay * workingDays * team.length;

  // Prepare team metadata
  const teamMetadata = {
    total_hours_logged: totalHoursLogged,
    total_hours_possible: totalHoursPossible,
    total_team_members: team.length,
    time_range: {
      start: startISO,
      end: endISO,
    }
    // Add any additional relevant fields here
  };

  // Prepare the final team data
  const teamData = Object.values(teamMembersMap).map(member => {
    const projects = Object.values(member.projects).map(projectInfo => {
      // Calculate possible hours for entries_meta
      projectInfo.entries_meta["hours logged possible"] = workingHoursPerDay * workingDays;

      return {
        project: projectInfo.project,
        entries: projectInfo.entries,
        entries_meta: projectInfo.entries_meta
      };
    });

    if(projects && projects.length){
      return {
        json: {
          name: member.name,
          identity_id: member.identity_id,
          projects: projects
        }
      };
    }

  }).filter(i => !!i);

  return {
    team_metadata: teamMetadata,
    team: teamData
  };
}

// Function to get the start and end dates based on the time range name
function getStartAndEndDates(timeRangeName) {
  const $now = new Date();

  // Helper functions to manipulate dates
  function startOf(unit, date) {
    const d = new Date(date);
    if (unit === 'week') {
      const day = d.getDay();
      const diff = d.getDate() - day + (day === 0 ? -6 : 1);
      d.setDate(diff);
      d.setHours(0, 0, 0, 0);
    } else if (unit === 'month') {
      d.setDate(1);
      d.setHours(0, 0, 0, 0);
    }
    return d;
  }

  function endOf(unit, date) {
    const d = new Date(date);
    if (unit === 'week') {
      const start = startOf('week', d);
      start.setDate(start.getDate() + 6);
      start.setHours(23, 59, 59, 999);
      return start;
    } else if (unit === 'month') {
      d.setMonth(d.getMonth() + 1);
      d.setDate(0);
      d.setHours(23, 59, 59, 999);
      return d;
    }
    return d;
  }

  function set(date, values) {
    const d = new Date(date);
    if (values.year !== undefined) d.setFullYear(values.year);
    if (values.month !== undefined) d.setMonth(values.month);
    if (values.week !== undefined) {
      d.setDate(d.getDate() - d.getDay() + 1 + 7 * (values.week - getWeekNumber(d)));
    }
    return d;
  }

  function getWeekNumber(d) {
    const date = new Date(Date.UTC(d.getFullYear(), d.getMonth(), d.getDate()));
    const dayNum = date.getUTCDay() || 7;
    date.setUTCDate(date.getUTCDate() + 4 - dayNum);
    const yearStart = new Date(Date.UTC(date.getUTCFullYear(), 0, 1));
    return Math.ceil((((date - yearStart) / 86400000) + 1) / 7);
  }

  let startDate, endDate;

  switch (timeRangeName) {
    case 'startOfWeekUntilToday':
      startDate = startOf('week', $now);
      endDate = $now;
      break;
    case 'lastWeek':
      const lastWeekDate = set($now, { week: getWeekNumber($now) - 1 });
      startDate = startOf('week', lastWeekDate);
      endDate = endOf('week', lastWeekDate);
      break;
    case 'startOfMonthUntilToday':
      startDate = startOf('month', $now);
      endDate = $now;
      break;
    case 'lastMonth':
      const lastMonthDate = set($now, { month: $now.getMonth() - 1 });
      startDate = startOf('month', lastMonthDate);
      endDate = endOf('month', lastMonthDate);
      break;
    default:
      throw new Error('Invalid time range name');
  }

  return { startDate, endDate };
}

// Function to calculate the number of working days between two dates
function getWorkingDaysBetweenDates(startDate, endDate) {
  let count = 0;
  let curDate = new Date(startDate);
  while (curDate <= endDate) {
    const dayOfWeek = curDate.getDay();
    if (dayOfWeek !== 0 && dayOfWeek !== 6) {
      // Exclude weekends
      count++;
    }
    curDate.setDate(curDate.getDate() + 1);
  }
  return count;
}

