  let member = teamMemberItem.json;
  let memberName = member.name;
  let identity_id = member.identity_id;
  let projects = member.projects;

  // Loop through projects
  projects.forEach(projectItem => {
    let project = projectItem.project;
    let entries = projectItem.entries;
    let entries_meta = projectItem.entries_meta;

    let project_id = project.id;
    let client_id = project.client_id || 'Unknown';

    // Initialize client in clients object if not exists
    if (!clients[client_id]) {
      clients[client_id] = {
        client_id: client_id,
        projects: {}
      };
    }

    let client = clients[client_id];

    // Initialize project in client.projects if not exists
    if (!client.projects[project_id]) {
      client.projects[project_id] = {
        project: project,
        team_members: {}
      };
    }

    let clientProject = client.projects[project_id];

    // Initialize team member in project.team_members if not exists
    if (!clientProject.team_members[identity_id]) {
      clientProject.team_members[identity_id] = {
        name: memberName,
        identity_id: identity_id,
        entries: [],
        entries_meta: entries_meta
      };
    }

    let clientProjectMember = clientProject.team_members[identity_id];

    // Add entries
    clientProjectMember.entries = clientProjectMember.entries.concat(entries);
    // Note: entries_meta is already assigned when initializing team member
  });
});

// Now, transform clients object into an array
let clientsArray = [];

for (let client_id in clients) {
  let client = clients[client_id];
  let projectsArray = [];

  for (let project_id in client.projects) {
    let projectInfo = client.projects[project_id];
    let teamMembersArray = [];

