        identity_id: memberInfo.identity_id,
        entries: memberInfo.entries,
        entries_meta: memberInfo.entries_meta
      });
    }

    projectsArray.push({
      project: projectInfo.project,
      team_members: teamMembersArray
    });
  }

  clientsArray.push({
    client_id: client_id,
    projects: projectsArray
  });
};

